import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Useroutput from "./components/useroutput";
import Userinput from "./components/userinput";
import "./App.css";

class App extends Component {
  state = {
    content: [{ name: "Chandan" }, { name: "Rishiraj" }],
  };
  render() {
    return (
      <div className="App">
        <Container>
          <Row>
            <Useroutput
              username={this.state.output.name[0]}
              paragraph="This is Chandan Baruah and I am learning React"
            />
            <Useroutput
              username={this.state.output.name[1]}
              paragraph="This is Rishi and I am learning React"
            />
            <Userinput />
          </Row>
        </Container>
      </div>
    );
  }
}

export default App;
